import * as React from 'react';
import { connect } from "react-redux";

class SubmitForm extends React.Component {
  render () {
    return (
      <div className="container">
        <form>
          <div className="form-row">
            <div className="form-group col-md-6">
              <label htmlFor="inputEmail4">Title</label>
              <input
                type="text"
                className="form-control"
                placeholder="Title"
                required
              />
            </div>
            <div className="form-group col-md-6">
              <label htmlFor="inputPassword4">Text</label>
              <input
                type="text"
                className="form-control"
                placeholder="Text"
                required
              />
            </div>
            <div className="form-group col-md-12">
              <input
                type="file"
                className="form-control"
                id="validatedCustomFile"
                required
              />
              <label className="custom-file-label" htmlfor="validatedCustomFile" style={{marginLeft: '5px',marginRight: "5px"}}>
                Choose file...
              </label>
            </div>
          </div>
          <button type="submit" className="btn btn-primary">
            Sign in
          </button>
        </form>
      </div>
    );
  }
  componentDidMount(){
      this.props.getData();
  }
}

const mapStateToProps = (state) => {
    return {
    };
  };
  
  const mapDispatchToProps = (dispatch) => {
    return {
      getData: () => dispatch({ type: "PRODUCT_CREATE_REQUEST"}),
    };
  };
export default connect(mapStateToProps, mapDispatchToProps)(SubmitForm);
